import React from 'react';
function Hero() {
    return ( 
        <div className='container'>
            <div className='row mt-5 mb-5 fs-2 text-center'>
                <h1>
                    We pioneered the discount broking model in India. <br></br>
                    Now, we are breaking ground with our technology.
                </h1>      
            </div>
        </div>
     );
}

export default Hero;
